(function(){var loadHandler=window['sl_{3EAD98A8-83D1-42BE-A13F-4688E90666E9}'];loadHandler&&loadHandler(10, '<div id="spr0_143604d"><div id="spr1_143604d" class="kern slide"><img id="img1_143604d" src="data:image/png;base64," width="1280px" height="720px" alt="" style="left:0px;top:0px;"/></div><div id="spr2_143604d" class="kern slide"><div id="spr3_143604d" style="left:923.944px;top:29.418px;"><div style="width:0px;"><span id="txt0_143604d" data-width="285.906250" style="left:12.56px;top:8.172px;">The Change</span></div><div style="width:0px;"><span id="txt1_143604d" data-width="241.875000" style="left:65.9px;top:84.972px;">Of Voices</span></div></div><div id="spr4_143604d" style="left:985.251px;top:419.637px;"><img id="img0_143604d" src="data:image/png;base64," width="246.75" height="247.5" alt="" style="left:0.061px;top:-0.22px;"/></div><div id="svg1_143604d" style="left:995.801px;top:400.304px;"><svg width="255" height="255" viewBox="-3 -3 255 255"><ellipse fill="none" stroke="#b2cfdf" stroke-width="2" stroke-linecap="butt" stroke-linejoin="miter" stroke-miterlimit="8" cx="124.457" cy="124.457" rx="123.457" ry="123.457"/></svg></div><div id="svg2_143604d" style="left:72.697px;top:155.7px;"><svg width="98" height="39" viewBox="0 0 98 39"><path fill="#73aea1" d="M0,0 h97.554 v38.512 h-97.554 Z"/></svg></div><div id="spr5_143604d" style="left:72.697px;top:155.7px;"><div style="width:0px;"><span id="txt2_143604d" data-width="22.997334" style="left:37.277px;top:2.406px;">01</span></div></div><div id="svg3_143604d" style="left:72.697px;top:400.381px;"><svg width="98" height="39" viewBox="0 0 98 39"><path fill="#73aea1" d="M0,0 h97.554 v38.512 h-97.554 Z"/></svg></div><div id="spr6_143604d" style="left:72.697px;top:400.381px;"><div style="width:0px;"><span id="txt3_143604d" data-width="22.997334" style="left:37.277px;top:2.406px;">02</span></div></div><div id="spr7_143604d" style="left:59.952px;top:209.65px;"><div style="width:0px;"><span id="txt4_143604d" class="nokern relpos" dir="auto" style="left:0.033px;top:4.236px;">•</span> <span id="txt5_143604d" class="relpos" data-width="1146.666626" style="left:16.398px;top:-6.796px;">英语的语态指主动语态和被动语态，英语中被动语态使用广泛，这与其物称倾向相辅相成；汉语中</span></div><div style="width:0px;"><span id="txt6_143604d" data-width="1146.666626" style="left:23.867px;top:31.604px;">被动语态使用相对较少，很多时候带有一种强制意味，多用会使文章表达显得不够自然。因此，英</span></div><div style="width:0px;"><span id="txt7_143604d" data-width="1146.666626" style="left:23.867px;top:70.004px;">译汉时，在可以译为汉语主动句，且符合汉语语法规则、生动自然的时候，一般将英语被动句译为</span></div><div style="width:0px;"><span id="txt8_143604d" data-width="160.000000" style="left:23.867px;top:106.084px;">汉语主动句。</span></div></div><div id="spr8_143604d" style="left:59.952px;top:55.113px;"><div style="width:0px;"><span id="txt9_143604d" data-width="62.306667" style="left:9.6px;top:-1.149px;">Ⅲ.</span></div><div style="width:0px;"><span id="txt10_143604d" data-width="185.960007" style="left:69.907px;top:-1.149px;">语态转化</span></div></div><div id="spr9_143604d" style="left:59.952px;top:404.304px;"><div style="width:0px;"><span id="txt11_143604d" class="nokern relpos" dir="auto" style="left:0.033px;top:46.425px;">•</span> <span id="txt12_143604d" class="relpos" data-width="459.359985" style="left:14.904px;top:35.747px;">Years may wrinkle the skin, but to </span> <span id="txt13_143604d" class="relpos" data-width="270.816010" style="left:14.897px;top:34.531px;">give up enthusiasm</span></div><div style="width:0px;"><span id="txt14_143604d" data-width="229.152023" style="left:23.867px;top:74.131px;">wrinkles the soul.</span></div><div style="width:0px;"><span id="txt15_143604d" class="nokern relpos" dir="auto" style="left:0.033px;top:137.422px;">•</span> <span id="txt16_143604d" class="relpos" data-width="853.333313" style="left:16.398px;top:126.39px;">此处为英语主动转被动，实际上此处在汉语里带有强制意味的主观表述，</span></div><div style="width:0px;"><span id="txt17_143604d" data-width="773.333313" style="left:23.867px;top:159.186px;">比英语中的物称客观表述，更带有作者情感。具体情况具体分析。</span></div></div></div></div>', '{"s":[]}');})();